def minPath(grid, k):
    N = len(grid)
    nums = [grid[i][j] for i in range(N) for j in range(N)]

    def get_neighbors(i, j):
        neighbors = []
        if i-1 >= 0:
            neighbors.append((i-1, j))
        if i+1 < N:
            neighbors.append((i+1, j))
        if j-1 >= 0:
            neighbors.append((i, j-1))
        if j+1 < N:
            neighbors.append((i, j+1))
        return neighbors

    def dfs(path, i, j):
        if len(path) == k:
            return path

        path.append(grid[i][j])
        neighbors = get_neighbors(i, j)
        min_path = None
        for neighbor in neighbors:
            ni, nj = neighbor
            if (ni, nj) not in path:
                new_path = dfs(path.copy(), ni, nj)
                if not min_path or tuple(new_path) < tuple(min_path):
                    min_path = new_path

        return min_path

    min_path = None
    for i in range(N):
        for j in range(N):
            path = dfs([], i, j)
            if not min_path or tuple(path) < tuple(min_path):
                min_path = path

    return min_path

