def minPath(grid, k):
    n = len(grid)
    m = len(grid[0])

    def dfs(x, y, path):
        if len(path) == k:
            return path

        neighbors = []
        if x > 0: neighbors.append((x-1, y))
        if x < n-1: neighbors.append((x+1, y))
        if y > 0: neighbors.append((x, y-1))
        if y < m-1: neighbors.append((x, y+1))

        neighbors.sort(key=lambda p: grid[p[0]][p[1]])

        for nx, ny in neighbors:
            res = dfs(nx, ny, path + [grid[nx][ny]])
            if res:
                return res

    start = min((grid[i][j], i, j) for i in range(n) for j in range(m))
    return dfs(start[1], start[2], [start[0]])

