def minPath(grid, k):
    N = len(grid)
    grid_values = [cell for row in grid for cell in row]
    start = min(grid_values)
    path = [start]
    visited = set()
    visited.add(start)

    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]

    def is_valid(x, y):
        return 0 <= x < N and 0 <= y < N

    def dfs(x, y, steps):
        if steps == k:
            return True

        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if is_valid(nx, ny):
                next_cell = grid[nx][ny]
                if next_cell not in visited:
                    visited.add(next_cell)
                    path.append(next_cell)
                    if dfs(nx, ny, steps + 1):
                        return True
                    visited.remove(next_cell)
                    path.pop()

        return False

    for i in range(N):
        for j in range(N):
            if grid[i][j] == start:
                if dfs(i, j, 1):
                    return path

