    if txt[-1].isalpha() and (len(txt) == 1 or not txt[-2].isalpha()):
        return True
    return False

def digits(n):
    product = 1
    for digit in str(n):
        if int(digit) % 2 != 0:
            product *= int(digit)
    return product if product != 1 else 0

def can_arrange(arr):
    max_index = -1
    for i in range(1, len(arr)):
        if arr[i] < arr[i-1]:
            max_index = i-1
    return max_index

def split_words(txt):
    if ' ' in txt:
        return txt.split()
    elif ',' in txt:
        return txt.split(',')
    else:
        return sum(1 for char in txt if char.islower() and ord(char) % 2 == 1)

def prod_signs(arr):
    if not arr:
        return None
    product = 1
    for num in arr:
        product *= 1 if num == 0 else num / abs(num)
    return sum(abs(num) for num in arr) * product

def get_odd_collatz(n):
    collatz_seq = [n]
    while n != 1:
        if n % 2 == 0:
            n = n // 2
        else:
            n = 3 * n + 1
        collatz_seq.append(n)

    return sorted([num for num in collatz_seq if num % 2 != 0])

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']':
            if stack and stack[-1] == '[':
                stack.pop()
    return len(stack) > 0

