def words_in_sentence(sentence):
    def is_prime(n):
        if n < 2:
            return False
        for i in range(2, int(n ** 0.5) + 1):
            if n % i == 0:
                return False
        return True

    words = sentence.split()
    prime_words = [word for word in words if is_prime(len(word))]
    return ' '.join(prime_words)

def tri(n):
    if n == 0:
        return [0]
    elif n == 1:
        return [1, 3]
    else:
        tribonacci = [0, 1, 3]
        for i in range(3, n + 1):
            if i % 2 == 0:
                tribonacci.append(1 + i // 2)
            else:
                tribonacci.append(tribonacci[i - 1] + tribonacci[i - 2] + tribonacci[i + 1])
        return tribonacci

def even_odd_palindrome(n):
    def is_palindrome(num):
        return str(num) == str(num)[::-1]

    even_count = 0
    odd_count = 0

    for i in range(1, n+1):
        if is_palindrome(i):
            if i % 2 == 0:
                even_count += 1
            else:
                odd_count += 1

    return (even_count, odd_count)

def get_max_triples(n):
    count = 0
    for i in range(1, n+1):
        a_i = i * i - i + 1
        for j in range(i+1, n+1):
            a_j = j * j - j + 1
            for k in range(j+1, n+1):
                a_k = k * k - k + 1
                if (a_i + a_j + a_k) % 3 == 0:
                    count += 1
    return count

def largest_smallest_integers(lst):
    neg_integers = [num for num in lst if num < 0]
    pos_integers = [num for num in lst if num > 0]

    largest_neg = max(neg_integers) if neg_integers else None
    smallest_pos = min(pos_integers) if pos_integers else None

    return (largest_neg, smallest_pos)

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]
    if planet1 not in planets or planet2 not in planets:
        return ()
    start_index = planets.index(planet1)
    end_index = planets.index(planet2)
    if start_index > end_index:
        start_index, end_index = end_index, start_index
    return tuple(planets[start_index+1:end_index])

def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            return False
    return True

def intersection(interval1, interval2):
    start1, end1 = interval1
    start2, end2 = interval2
    start = max(start1, start2)
    end = min(end1, end2)
    if end < start:
        return "NO"
    length = end - start
    return "YES" if is_prime(length) else "NO"

def x_or_y(n, x, y):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    return x if is_prime(n) else y

def Strongest_Extension(class_name, extensions):
    def strength(extension):
        return sum(1 for c in extension if c.isupper()) - sum(1 for c in extension if c.islower())

    strongest = max(extensions, key=lambda x: strength(x))
    return f"{class_name}.{strongest}"

def int_to_mini_roman(number):
    roman_numerals = {
        1: 'i', 4: 'iv', 5: 'v', 9: 'ix', 10: 'x', 40: 'xl', 50: 'l',
        90: 'xc', 100: 'c', 400: 'cd', 500: 'd', 900: 'cm', 1000: 'm'
    }
    result = ''
    for value, numeral in sorted(roman_numerals.items(), reverse=True):
        while number >= value:
            result += numeral
            number -= value
    return result.lower()

def do_algebra(operator, operand):
    expression = str(operand[0])
    for i in range(len(operator)):
        expression += operator[i] + str(operand[i+1])
    return eval(expression)

import hashlib

def string_to_md5(text):
    if not text:
        return None
    return hashlib.md5(text.encode()).hexdigest()

def find_max(words):
    def unique_chars(word):
        return len(set(word))

    max_word = ""
    max_unique_chars = 0

    for word in words:
        unique_chars_count = unique_chars(word)
        if unique_chars_count > max_unique_chars or (unique_chars_count == max_unique_chars and word < max_word):
            max_word = word
            max_unique_chars = unique_chars_count

    return max_word

def even_odd_count(num):
    even_count = len([int(digit) for digit in str(abs(num)) if int(digit) % 2 == 0])
    odd_count = len([int(digit) for digit in str(abs(num)) if int(digit) % 2 != 0])
    return (even_count, odd_count)

def compare_one(a, b):
    if type(a) == int and type(b) == int:
        if a > b:
            return a
        elif b > a:
            return b
        else:
            return None
    elif type(a) == float and type(b) == float:
        if a > b:
            return a
        elif b > a:
            return b
        else:
            return None
    elif type(a) == str and type(b) == str:
        a_num = float(a.replace(",", "."))
        b_num = float(b.replace(",", "."))
        if a_num > b_num:
            return a
        elif b_num > a_num:
            return b
        else:
            return None
    elif type(a) == int and type(b) == float:
        return b if b > a else a if a > b else None
    elif type(a) == float and type(b) == int:
        return b if b > a else a if a > b else None
    elif type(a) in [int, float] and type(b) == str:
        b_num = float(b.replace(",", "."))
        return b if b_num > a else a if a > b_num else None
    elif type(a) == str and type(b) in [int, float]:
        a_num = float(a.replace(",", "."))
        return a if a_num > b else b if b > a_num else None

def minPath(grid, k):
    n = len(grid)
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]

    def backtrack(i, j, path):
        if len(path) == k:
            return path

        current_value = grid[i][j]
        grid[i][j] = 0  # mark cell as visited

        next_paths = []
        for di, dj in directions:
            new_i, new_j = i + di, j + dj
            if 0 <= new_i < n and 0 <= new_j < n and grid[new_i][new_j] != 0:
                next_paths.append((new_i, new_j, path + [grid[new_i][new_j]]))

        next_paths.sort(key=lambda x: x[2])

        for new_i, new_j, new_path in next_paths:
            result = backtrack(new_i, new_j, new_path)
            if result:
                return result

        grid[i][j] = current_value  # backtrack

    start_paths = [(i, j, [grid[i][j]]) for i in range(n) for j in range(n)]
    start_paths.sort(key=lambda x: x[2])

    for i, j, path in start_paths:
        result = backtrack(i, j, path)
        if result:
            return result
